import './TodoItem.css'

function TodoItem(props) {
    return (
        <li className='box-clicks'>
            <span className='click-v click-v--complete'>V</span>
            <p className='todo todo-v--complete'>{props.text}</p>
            <span className='click-x click-x--delete'>X</span>
        </li>
    );
}
export {TodoItem};
